measurements.description:
One full flower on one 18-cm inflorescence; 
	dorsal sepal white, light green basally, large thick dark burgundy spots, plentiful centrally; 
	synsepal white overlaid chartreuse, dark burgundy spots lined vertically; 
	petals chartreuse, overlaid mahogany, thick dark burgundy spots basally;
	pouch chartreuse, overlaid mahogany, rimmed chartreuse; staminode chartreuse, lightly spotted burgundy;
	substance firm; texture waxy.
